import React from "react";
import "./Header.css"

function Header() {
  return (
    <>
      <ul>
        <li>
          <img src="https://images.shiksha.com/mediadata/images/1631617292phpdoIYuQ.jpeg"  
           alt="DDU logo" /></li>
      </ul>
    </>
  );
}

export default Header;
